      function spinTheWheel() {
        console.log("hi!");

        const grid = document.querySelector(".chosen-sets-grid");
        grid.innerHTML = "";

        const choices = [];
        while (choices.length < 6) {
            const choice = sets[Math.floor(Math.random() * sets.length)];
            if (!choices.includes(choice)) choices.push(choice);
        }

        for (const choice of choices) {
            const c = document.createElement("div");
            c.classList.add("chosen-set");
            c.innerHTML = `
              <h3>${choice.Set}</h3>
              ${choice["Expansion Symbol"]}
              <p>${choice["Expansion Code"]}</p>
              <p>${choice["Total Cards"]} - ${choice["Release Date"]}</p>
            `;
           grid.appendChild(c);
        }
      }
